import React, { Component } from 'react';
import Header from './components/Header';
import Navbar from './components/Navbar';
import ParkView from './containers/ParkView';
import PaddockView from './containers/PaddockView';
import DinosaurView from './containers/DinosaurView';
import './App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      renderedPage: []
        }
  }


  render() {

    if(this.state.renderedPage.equals("park")){
      return(
        <>
          <Header />
          <Navbar />
          <ParkView />
        </>
      )
    }
    if(this.state.renderedPage.equals("paddock")){
      return(
        <>
          <Header />
          <Navbar />
          <PaddockView />
        </>
      )
    }
    if(this.state.renderedPage.equals("dino")){
      return(
        <>
          <Header />
          <Navbar />
          <DinosaurView />
        </>
      )
    }
    else{
      return(
        <>
          <Header />
          <Navbar />
          <ParkView />
        </>
      )
    }
    }
